	useEffect(() => {
  document.body.className = 'create';
  return () => { document.body.className = 'dark'; }


},);
  return(

        <div id="notfound" style={{position:"relative"}}>
		<div className="notfound">
			<div className="notfound-404">
				<div></div>
				<h1>404</h1>
			</div>
			<h2>Page not found</h2>
